function getLotteryOfTurn(turn) {
	return lotteryDataAll[lotteryDataAll.length - turn];
}

function getLotteryOfRange(turn, range) {
	range = range || lotteryDataAll.length;
	
	return lotteryDataAll.filter(function(data) { 
		return data.turn <= turn;
	}).splice(0, range);
	
}
